.
400 g de couve-flor cozida
1 col chá de sal
pimenta do reino a gosto
Noz moscada a gosto
4 ovos
2 xícara de farinha de aveia ou outra sem glúten
1 cebola picada
1 dente de alho
1 cenoura ralada
Frango desfiado
2 Tomates picados ou tomatinho cereja a gosto
Salsinha a gosto
Azeite

Sugestões de recheio: espinafre, tomate seco, queijo, frango, carne moída, alho-poró, aspargos…. Comece refogando no azeite, a cebola o alho e o frango. Acerte temperos de sal e pimenta do reino, coloque os tomates, a cenoura e deixe apurar. Finalize com a salsinha.
Num liquidificador ou processador, bata a couve-flor, os ovos, a farinha (que eu esqueci de colocar, mas é meio óbvio neh gente), o queijo cremoso (qto quiser, só para dar cremosidade, é opcional), o sal, acerte temperos de pimenta do reino, noz moscada. Depois de batido, misture o recheio à massa. Unte uma assadeira com óleo, leve para assar em forno preaquecido 180 graus por uns 20 minutos aproximadamente.
.
