Os feriados são belas oportunidades de descanso para o corpo, mas também representam uma grande ameaça para o plano de alimentação e treino.

Flexibilizar os cuidados durante os dias de folga pode pesar não só na consciência, como também na balança. Exagerar um pouco nas datas festivas, feriados e finais de semana faz parte, mas é preciso tomar algumas precauções e medidas posteriores para amenizar os efeitos dos excessos.

Para reduzir o risco de maiores estragos, continue se exercitando durante o feriado. Se você estiver longe de casa ou a academia estiver fechada, faça uma caminhada, nade, e etc. Essas atividades podem ser super prazerosas e ajudam a manter o corpo em forma.

E se mesmo assim você não resistir; 
não se desespere se você acabar passando da conta no feriado. Assim que a rotina voltar ao normal, foque novamente para recuperar o prejuízo.

 E no mais, é vida que segue!
Quanto mais você investir numa alimentação adequada e treinos regulares, menos dificuldade você terá para resistir às tentações dos feriados. 😉

