";s:5:"image";}i:126;a:1:{s:8:"owner_id";i:32320995238;}i:127;a:1:{s:14:"owner_username";s:0:"";}i:128;a:1:{s:14:"owner_fullname";s:0:"";}i:129;a:1:{s:9:"owner_pic";s:0:"";}i:130;a:1:{s:2:"id";s:19:"2391066804595087069";}i:131;a:1:{s:10:"short_code";s:11:"CEuxpciHlbd";}i:132;a:1:{s:12:"created_time";i:1599257396;}i:133;a:1:{s:7:"caption";s:1067:"👩🏻‍🍳Receita 👩🏻‍🍳

Cookies de chocolate funcional 🍪🍫

Ingredientes:
- 30 gramas de chocolate picado ou gotas de chocolate (preferência sem açúcar)
- 1/4 xícara de farinha de coco
- 1 1/3 farinha de amêndoas 
- 2 colheres de sopa de chia 
- 1/3 xícara de açúcar demerara ou xilitol 
- 1/2 colher de chá de extrato de baunilha 
- pitada de sal 
- 1/2 colher de chá de fermento em pó
- 1 ovo
- 3 colheres de sopa de óleo de coco

🥣 Modo de preparo: 
Misture os ingredientes secos em um bowl. Depois adicione o restante dos ingredientes e misture bem até formar uma massinha. Deixe descansar por 15 minutos na geladeira, isso fará com que ele fique mais fácil para moldar e ficar mais crocante). Em uma forma com papel manteiga, modele os cookies e coloque para assar em forno pré aquecido em 180 graus por 10 a 15 minutos. Prontinho! 😉

Bom apetite! 😋😉
